import React from 'react';

const RedBox = ({ children }) => {
  const boxStyle = {
    backgroundColor: 'red',
    width: '100%',
    padding: '20px', // You can adjust the padding as needed
    boxSizing: 'border-box',
    color: 'white', // Text color inside the red box
  };

  return (
    <div style={boxStyle}>
      {children}
    </div>
  );
};
RedBox.propTypes = {
children: PropTypes.node.isRequired,
  };

export default RedBox;
